var hosturl = "0.0.0.0";
var wsport = 3100;
var oscport = 8000;

var idle = true;
var sel = 0;

// WebSocket Serverを立ち上げる
var WebSocketServer = require('ws').Server;
var wss = new WebSocketServer({host:hosturl, port:wsport});

// OSC Senderを立ち上げる
var oscsender = require('omgosc').UdpSender;
var sender = new oscsender(hosturl, oscport);

// WebSocketのイベントハンドラ
wss.on('connection', function (ws) {
    ws.on('message', function (message) {
        console.log(message);
        var mes = JSON.parse(message);
        if(mes.osc){    // チェック甘！
                // OSCで送信
            sender.send(mes.path,mes.type,[mes.data]);
        }

        switch (mes.path) {
			case '/mv/file':
				switch (mes.data) {
					case 'do.mp4':
						sel = 0;
						break;
					case 'gr.mp4':
						sel = 1;
						break;
					case 'ro.mp4':
						sel = 2;
						break;
				}
				break;
			case '/mv/menu':
				idle = true;
				break;
			case '/mv/play':
				idle = false;
				break;
			case '/mv/pause':
				idle = true;
				break;
			case '/mv/seek':
				break;
		}
    });
});

////////////////////////////////

async function entry(json) {
    console.log('send:' + json.timestamp);
    await client.index({index:"sensor", type:"sensor_data", body:json});
}

async function del(json) {
    console.log('delete all');
    await client.deleteByQuery({index:"sensor", body:{query:json}});
}

var elasticsearch = require('elasticsearch');
var client = new elasticsearch.Client({
    host: 'localhost:9200'
});

console.log('server start');
let i = 0;
let j = 0;
del({"match_all":{}});
setInterval(()=> {
	if (idle) {
		return;
	}
    if (i >= data[sel].length) {
        j++;
        if (j > 5) {
            del({"match_all":{}});
            i = 0;
            j = 0;
        }
    } else {
        entry(data[sel][i]);
        i++;
    }
}, 500);

